        <div className="App">
            <header className="App-header">

                <button className="btn btn-primary"><a href="/login"><h3 style={{color:"purple"}}>Login</h3></a>
                    </button>
                <a href="/register"><h3>Register</h3></a>

            </header>
        </div>

    );
};

